import { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Home from "./Home";
import Empty from "./Empty";
import NotLogged from "./NotLogged";

import Component1 from "./components/Component1";
import Component2 from "./components/Component2";
import Component3 from "./components/Component3";

function App() {
  const [logged, setLogged] = useState(false);
  return (
    <BrowserRouter>
      <Routes>
        <Route
          exact
          path="/"
          element={<Home logged={logged} setLogged={setLogged} />}
        >
          {logged ? (
            <>
              <Route path="*" element={<Empty />} />
              <Route exact path="Component1" element={<Component1 />} />
              <Route exact path="Component2" element={<Component2 />} />
              <Route exact path="Component3" element={<Component3 />} />
            </>
          ) : (
            <>
              <Route exact path="NotLogged" element={<NotLogged />} />
              <Route path="*" element={<Empty />} />
            </>
          )}
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
